import java.util.HashMap;

 public class ImageResource
{
	 private HashMap<String, String> _map;
	 private static ImageResource _instance;

	public static ImageResource getInstance() { 
		 if (_instance == null) 
		 { _instance = new ImageResource();_instance.createData();} 
		 return _instance;
	}

	public String getImageBase64String(String imageName)
	{
		 return _map.get(imageName);
	}

	public void createData()
	{
		 _map = new HashMap<String, String>();
		 _map.put("Deshboard.png", "");
	}
}